import "./App.css";
import React from "react";
import Navbar from "./components/Navbar/navbar";
import About from "./components/About/about";
import Home from "./components/Home/home";
// import Project from "./components/Project/project";
import Experience from "./components/Experience/experience";
import { motion } from "framer-motion";

// Animation Stuffs
const NavbarVariant = {
  hidden: {
    y: "-10vh",
  },
};

function App() {
  return (
    <>
      <motion.div
        initial="hidden"
        animate={{ y: 0 }}
        transition={{
          delay: 1.2,
          duration: 1.5,
          type: "spring",
          stiffness: 90,
        }}
      >
        <Navbar />
      </motion.div>

      <motion.div
        initial={{ x: "-100vw", y: "100vh" }}
        animate={{ x: "0vw", y: "7.5vh" }}
        transition={{
          delay: 0.7,
          duration: 1.5,
          type: "spring",
          stiffness: 70,
        }}
      >
        <Home />
      </motion.div>
      <About />
      {/* <Project /> */}
      <Experience />
    </>
  );
}

export default App;
